package LoopWhile;

public class BreakAndContuine {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
            for(int i=1; i<=100; i++) 
            {
            	
            	if(i == 10)
            		
            		continue;
            	
            	System.out.println(i);
            }
	}

}
